import "./App.css";
import FaceIcon from "./face-icon.svg"

function App() {
  return (
    <div className="pageWrap">
      <div className="block1">
      <object type="image/svg+xml" data={FaceIcon} alt="face icon"></object>
      <img src={FaceIcon} alt="React Logo" id="faceIcon"/>
      <div className="title">
        Hi, my <br></br>
        name is <span style={{ fontWeight: "800" }}>Khushi!</span>
      </div>
      <div className="subText">
        I'm a second-year{" "}
        <span style={{ fontWeight: "800" }}>Software-Engineering student</span> at<br></br>
        the University of Waterloo.
      </div>
      </div>
    </div>
  );
}

export default App;
